import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { MilitarListComponent } from './militar-list/militar-list.component';
import { CreateMilitarComponent } from './create-militar/create-militar.component';
import { UpdateMilitarComponent } from './update-militar/update-militar.component';
import { MilitarDetailsComponent } from './details-militar/details-militar.component';
import { DetailsEnderecoComponent } from './details-endereco/details-endereco.component';
import { CreateEnderecoComponent } from './create-endereco/create-endereco.component';
import { EnderecoListComponent } from './endereco-list/endereco-list.component';
import { UpdateEnderecoComponent } from './update-endereco/update-endereco.component';
import { HomeComponent } from './home/home.component';
const routes: Routes = [
  {path: 'home', redirectTo: '', pathMatch: 'full'},
  { path: 'militars-list', component: MilitarListComponent },
   { path: 'create-militar', component: CreateMilitarComponent },
   { path: 'update-militar/:id', component: UpdateMilitarComponent},
   { path:  'militar-details/:id', component: MilitarDetailsComponent },
   { path: 'enderecos-list', component: EnderecoListComponent },
   { path: 'create-endereco', component: CreateEnderecoComponent },
   { path: 'endereco-details/:id', component: DetailsEnderecoComponent },
   { path: 'update-endereco/:id', component: UpdateEnderecoComponent},
   { path: 'home', component: HomeComponent}

];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
